SKIP_TAGS = {"unreachable", "demo_feed", "schedule_frequencies", "download_page_url", "source_webpage"}

ALLTAGS = set()
FEED_TAG_UPDATES = {}
for feed in FEED_TAGS:
    tags2 = {}
    for k,v in feed['tags'].items():
        ALLTAGS.add(k)
        if k in SKIP_TAGS:
            continue
        tags2[k] = v
    if len(tags2) > 0:
        FEED_TAG_UPDATES[feed['onestop_id']] = tags2

      
print("ALLTAGS:", ALLTAGS)

for fn in glob.glob("feeds/*.dmfr.json"):
    d = {}
    with open(fn,  encoding="utf-8") as ff:
        d = json.load(ff)
    
    f2 = []
    updated = False
    for feed in d['feeds']:
        updated_tags = FEED_TAG_UPDATES.get(feed['id'])
        if updated_tags:
            updated = True
            feed['tags'] = updated_tags
            f2.append(feed)
            print("updated feed:", feed)
        else:
            f2.append(feed)
    d['feeds'] = f2

    if updated:
        with open(fn, 'w',  encoding="utf-8") as ff:
            json.dump(d, ff, indent=2, ensure_ascii=False)

